script: |
  super -f text -I q7326.spq | sort > q7326.out

inputs:
  - name: q7326.spq
    data: |
      SELECT ALL - 25 * + 86 * - col2 + col2, col1 + col2 + - - col1 * col0 FROM tab1 (FORMAT parquet) WHERE + 89 / + ( - 78 ) <= - CAST ( + col0 AS INTEGER );
  - name: tab1

outputs:
  - name: q7326.out
    data: |
